import { useState, useRef } from 'react';
import Footer from './components/Footer';
import { BrowserRouter as Router, Route, Link  } from 'react-router-dom';

function App() {
  <Router>
    <div>
      <ul>
        <li>
          <Link to="/" >Home</Link>
        </li>
        <li>
          <Link to="/login">Login</Link>
        </li>
